import ExpenseItem from './components/ExpenseItem';

const App = () => {
	const expenses = [
		{
			id: 1,
			title: 'Toilet Paper',
			amount: 94.12,
			date: new Date(2020, 7, 14),
		},
		{
			id: 2,
			title: 'New TV',
			amount: 799.49,
			date: new Date(2021, 2, 12),
		},
		{
			id: 3,
			title: 'Car Insurance',
			amount: 294.67,
			date: new Date(2021, 2, 28),
		},
		{
			id: 4,
			title: 'New Desk (Wooden)',
			amount: 450,
			date: new Date(2021, 5, 12),
		},
	];

	return (
		<>
			<ExpenseItem
				id={expenses[0].id}
				title={expenses[0].title}
				amount={expenses[0].amount}
				date={expenses[0].date}
			/>
			<ExpenseItem
				id={expenses[0].id}
				title={expenses[0].title}
				amount={expenses[0].amount}
				date={expenses[0].date}
			/>
			<ExpenseItem
				id={expenses[0].id}
				title={expenses[0].title}
				amount={expenses[0].amount}
				date={expenses[0].date}
			/>
			<ExpenseItem
				id={expenses[0].id}
				title={expenses[0].title}
				amount={expenses[0].amount}
				date={expenses[0].date}
			/>
		</>
	);
};

export default App;
